import React, { Component } from 'react';

class RightCockpit extends Component {
  render() {
    let rightCockpitDisplay = <p>Hi Thomas</p>;
    return <React.Fragment>{rightCockpitDisplay}</React.Fragment>;
  }
}
export default RightCockpit;
